import { View, ImageBackground, Text, StyleSheet } from 'react-native';
import { LinearGradient } from 'expo-linear-gradient';
export default function HomeScreen() {
    return (
        <ImageBackground source={require('../assets/images/developer.jpg')} style={{ width: '100%', height: '100%' }}>
            <LinearGradient colors={["transparent", "blue"]} style={{ height: "100%" }} >
                <View style={{ display: "flex" }}>
                    <Text style={sheet.skip}>Hello</Text>
                </View>
            </LinearGradient>
        </ImageBackground>
    );
}

const sheet = StyleSheet.create({
    skip: {
        fontSize: 20,
        fontWeight:"bolder",
        alignSelf: "flex-start",
        marginLeft: "auto",
        marginRight: "10px",
        marginTop: "10px",
        color:"white"
    }
})
